import React from "react";

import "../css/components/listingThumb.css";

const style = {
  textAlign: "left",
  fontSize: "2vh"
};
const ListingThumb = props => {
  return (
    <div className="listingThumb">
      {props.job.jobTitle}
      <br />

      {props.job.company}
      <br />

      {props.job.jobType}
    </div>
  );
};

export default ListingThumb;
